import requests, os 
from bs4 import BeautifulSoup
os.system("clear")

from ironpdf import *

def fetch_data(prid):
    url = "https://pib.gov.in/PressReleasePage.aspx?PRID=" + str(prid)
    response = requests.get(url)

    # print(response.text)
    soup = BeautifulSoup(response.text, 'html.parser')

    print(str(soup.prettify()))

    
    # Instantiate Renderer
    renderer = ChromePdfRenderer()
    # Create a PDF from a URL or local file path
    pdf = renderer.RenderUrlAsPdf("https://pib.gov.in/PressReleasePage.aspx?PRID=1959592")
    # Export to a file or Stream
    pdf.SaveAs("url.pdf")



print(fetch_data(1959592))


